import React from 'react'
import Sidebar from './Sidebar'
import Content from './Content'

const Dashboard = () => {
  const dashStyle = {
    display: 'flex',
    alignItems: 'stretch',
  }

  return (
    <div style={dashStyle}>
      <Sidebar />
      <Content />
    </div>
  )
}

export default Dashboard
